My Girlfriend's Busty Friend - Alison Tyler
Added: October 3, 2014

Alison comes over to Richie's house looking for his girlfriend because they were going to go out today. He tells her that they got into a fight because he's been working too much and she left to who knows where. Alison starts to give Richie a massage and offers to take care of him since his girlfriend isn't taking care of this hard working man.
